import React from "react";
import "./education.css";


function Education() {
  return (
    <div className="card">
      <img
        src="https://via.placeholder.com/150"
        alt="Avatar"
        style={{ width: '100%' }}
      />
      <div className="container">
        <h4>
          <b>John Doe</b>
        </h4>
        <p>Software Engineer</p>
        <p>john@example.com</p>
      </div>
    </div>
  );
}

export default Education;
